`,r(e.p,{children:"I also had to do all of this while making enough time to attend my sister's volleyball tournament!"}),`
`,r(e.p,{children:'Under these conditions, it was crucial prioritize what are 100% required tasks to be done, and what are the "nice-to-haves" left over.'}),`
`,r(e.h4,{children:"priority 1: rigging"}),`
`,r(e.p,{children:"Rigging was top priority, no matter how unpolished the designs may be, if they can't be controlled, we don't have an event to show. So that was the first thing that I worked on implementing."}),`
`,r(e.p,{children:"Although animations were not being worked on, I made sure to bookmark the components that would need to be animated later whenever I knew I would need it. That way I was able to save myself a couple of hours once it was time to actually put the animations in!"}),`
`,r(e.h4,{children:"priority 2: polish"}),`
`,r(e.p,{children:"Once rigging was completed, and all of the bugs were ironed out, I knew next priority was polishing the designs, it made no sense to set up all of the layout transitions if the designs were to be restructured anyway! And to be honest, I couldn't let myself allow these graphics to remain untouched."}),`
`,r(e.p,{children:"This step was the one that took much longer than expected, as I ran into a lot of design issues and it was difficult to try to keep as much faithful to the original vision, while ensuring that it was feasible."}),`
`,r(e.p,{children:"One of the biggest challenges in this step was implementing all of the parts that were not part of the original design specification. For example the leaderboard, or how the maplist should show completed games."}),`
`,r(e.p,{children:r(e.img,{src:"/cg-fabl_6.gif",alt:"Here's a before/after of the roster screen! This gif was probably the most complex thing I've made with ffmpeg."})}),`
`,r(e.h4,{children:"priority 3: layout transitions"}),`
`,r(e.p,{children:"I think the design bit that I'm most proud of in this graphics bundle has to be the heading component!"}),`
`,r(e.p,{children:"It adapts to the content height by shifting up and down to ensure that the content below is evenly spaced, while the text inside the component fades to showcase whatever is relevant for the active page."}),`
`,r(e.p,{children:r(e.img,{src:"/cg-fabl_4.webm",alt:""})}),`
`,r(e.h4,{children:"priority 4: animations + treats!"}),`
`,r(e.p,{children:"At this point, I probably had about 6 hours left before the tournament started, so I had to pick what animations were important enough to show, the ones that were most common to be noticed by the viewer. Everything else would be delegated to the next season (this event ran over the course of 6 weeks)."}),`
`,r(e.p,{children:"The text fades on the heading component was among the first to implement, as well as the scoreboard and commentators panel on the game screen."}),`
`,r(e.p,{children:"The icons on the scoreboard were actually not part of the original design specification, or the first week! I just thought it would be really cool while finishing up all the rest of the animations! I think I made the right call."}),`
`,r(e.p,{children:r(e.img,{src:"/cg-fabl_5.webm",alt:""})}),`
`,r(e.hr,{}),`
`,r(e.p,{children:"I ended up still working on all of the animations and stuff even as the event was going on, it must have been funny for spectators to watch the graphics get progressively better as the tournament went on."}),`
`,r(e.p,{children:"Hope you enjoyed reading!"}),`
